専用のポンプで空気を抜くことで、雑菌の繁殖をおさえ、食材を長持ちさせる効果が期待できます。<br><br>
繰り返し使えて経済的。<br>
においの強い食材を入れておけば冷蔵庫内でのにおい移りを防ぐことができます。<br><br><BR>

